    - object:
        example_object: "DISCHARGE PREVENTION, CONTAINMENT AND COUNTERMEASURES (DPCC)\
          \ IS A STATE PROGRAM THAT  WORKS TO FORESTALL THE RELEASE OF HAZARDOUS SUBSTANCES\
          \ AND PETROLEUM PRODUCTS TO THE ENVIRONMENT, THEREBY PROTECTING NATURAL\
          \ RESOURCES AND PUBLIC HEALTH BEFORE PROBLEMS OCCUR. THE PROGRAM CENTERS\
          \ ON SOUND MANAGEMENT PRACTICES THAT ARE CONSIDERED ESSENTIAL WHEN WORKING\
          \ WITH HAZARDOUS SUBSTANCES.\_ THESE PRACTICES INCLUDE TRAINING EMPLOYEES\
          \ WHO HANDLE SUCH MATERIALS, PERIODICALLY INSPECTING STORAGE TANKS, AND\
          \ ASSURING THAT ADEQUATE SECONDARY CONTAINMENT IS IN PLACE, AS WELL AS DEVELOPING\
          \ STANDARD OPERATING PROCEDURES FOR ROUTINE OPERATIONS AND MAINTENANCE.\
          \ THE PROGRAM ALSO WORKS TO ENSURE THAT RESPONSE PLANS, TRAINED PERSONNEL\
          \ AND EMERGENCY EQUIPMENT ARE AT HAND SHOULD AN INCIDENT OCCUR. ALL FACILITIES\
          \ AND INDIVIDUALS IN THE STATE, EVEN HOMEOWNERS, ARE SUBJECT TO THE REPORTING\
          \ REQUIREMENTS SHOULD A DISCHARGE OF A HAZARDOUS SUBSTANCE OCCUR. HOWEVER,\
          \ THE MAJORITY OF THE REGULATORY REQUIREMENTS APPLY ONLY TO FACILITIES THAT\
          \ STORE 20,000 GALLONS OR MORE OF STATE-REGULATED HAZARDOUS SUBSTANCES,\
          \ EXCLUDING PETROLEUM PRODUCTS, OR 200,000 GALLONS OF REGULATED HAZARDOUS\
          \ SUBSTANCES INCLUDING PETROLEUM PRODUCTS. "
